INSERT INTO `explanation_cache` (`cache_id`, `question_id`, `user_answer_id`, `explanation`, `created_at`) VALUES
(1, 25, 98, 'Tag &lt;h1&gt; digunakan untuk membuat judul terbesar dalam HTML. Tag ini menandakan bahwa teks di dalamnya adalah yang paling penting dan biasanya digunakan untuk judul utama suatu halaman. Sementara itu, tag &lt;title&gt; digunakan untuk menentukan judul halaman yang muncul di tab browser, bukan untuk tampilan di dalam konten halaman.', '2025-07-12 16:01:35'),
(2, 26, 102, 'Dalam HTML, terdapat enam tingkat heading yang tersedia, yaitu dari &lt;h1&gt; hingga &lt;h6&gt;. Setiap tingkat heading memiliki tingkat kepentingan yang berbeda, di mana &lt;h1&gt; adalah yang paling tinggi dan &lt;h6&gt; adalah yang paling rendah. Penggunaan heading yang tepat membantu dalam struktur dan hierarki konten pada halaman web.', '2025-07-12 16:01:38'),
(3, 27, 106, 'Tag &lt;h6&gt; digunakan untuk menandai heading dengan ukuran teks paling kecil dalam HTML. Heading dimulai dari &lt;h1&gt; sebagai yang terbesar, hingga &lt;h6&gt; yang merupakan yang terkecil. Oleh karena itu, &lt;h6&gt; adalah jawaban yang tepat untuk teks paling kecil.', '2025-07-12 16:01:40'),
(4, 28, 112, 'Tag &lt;h1&gt; digunakan untuk menandai judul utama dari sebuah halaman web, sehingga hanya perlu ada satu untuk menjaga konsistensi dan hierarki informasi. Memiliki lebih dari satu tag &lt;h1&gt; dapat membingungkan mesin pencari dalam memahami konten utama halaman, yang dapat berdampak negatif pada optimasi SEO. Dengan demikian, penggunaan satu tag &lt;h1&gt; membantu meningkatkan visibilitas halaman di hasil pencarian.', '2025-07-12 16:01:42'),
(5, 29, 116, 'Tag &lt;p&gt; digunakan untuk membuat paragraf teks di HTML. Tag ini membungkus teks dan memberi jarak antar paragraf secara otomatis, sehingga meningkatkan keterbacaan konten. Dengan menggunakan tag &lt;p&gt;, pengembang web dapat mengorganisir teks dengan lebih baik dalam dokumen HTML.', '2025-07-12 16:01:44'),
(6, 30, 119, 'Tag &lt;br&gt; digunakan dalam HTML untuk menambahkan jeda baris baru dalam teks tanpa memulai paragraf baru. Ini berguna ketika Anda ingin memisahkan teks dalam satu elemen, seperti dalam sebuah daftar atau alamat. Dengan menggunakan &lt;br&gt;, Anda dapat mengatur tampilan teks agar lebih rapi dan terstruktur.', '2025-07-12 16:01:45'),
(7, 31, 123, 'Tag &lt;p&gt; digunakan untuk menampilkan paragraf teks dalam dokumen HTML. Dengan menggunakan tag ini, pengembang web dapat mengorganisir dan memformat konten teks agar lebih mudah dibaca. Tag &lt;p&gt; secara otomatis memberikan jarak sebelum dan sesudah teks, sehingga meningkatkan keterbacaan.', '2025-07-12 16:01:46'),
(8, 32, 128, 'Tag &lt;br&gt; digunakan untuk membuat garis baru dalam teks. Dengan menulis &lt;p&gt;Halo&lt;br&gt;Selamat datang&lt;/p&gt;, teks &quot;Selamat datang&quot; akan ditampilkan pada baris baru setelah &quot;Halo&quot;. Oleh karena itu, hasilnya adalah &quot;Selamat datang&quot; muncul di baris baru setelah &quot;Halo&quot;.', '2025-07-12 16:01:48'),
(9, 33, 129, 'Tag &lt;b&gt; digunakan untuk membuat teks tebal dalam HTML. Dengan menggunakan tag ini, teks yang terletak di dalamnya akan ditampilkan dengan gaya yang lebih mencolok. Sementara itu, tag &lt;i&gt; digunakan untuk membuat teks miring, bukan tebal.', '2025-07-12 16:01:49'),
(10, 34, 133, 'Tag &lt;i&gt; digunakan untuk membuat teks miring dalam HTML. Tag ini menandakan bahwa teks yang berada di dalamnya memiliki penekanan atau makna khusus. Sementara itu, tag &lt;bold&gt; tidak ada dalam standar HTML; yang benar untuk membuat teks tebal adalah tag &lt;b&gt;.', '2025-07-12 16:01:51'),
(11, 35, 138, 'Tag &lt;b&gt; digunakan untuk membuat teks tampil tebal secara visual tanpa memberikan makna tambahan. Sementara itu, tag &lt;strong&gt; tidak hanya membuat teks tebal, tetapi juga menunjukkan bahwa teks tersebut memiliki makna penting, sehingga dapat diinterpretasikan oleh mesin pencari dan pembaca layar. Oleh karena itu, perbedaan utama terletak pada fungsi semantik dan visual yang diberikan oleh kedua tag tersebut.', '2025-07-12 16:01:53'),
(12, 36, 142, 'Tag &lt;em&gt; digunakan untuk menandai teks yang harus diberi penekanan. Secara semantik, teks yang dibungkus dalam tag ini biasanya ditampilkan dalam bentuk miring oleh browser, sehingga membantu pembaca memahami bagian yang lebih penting dari sebuah konten. Penggunaan tag &lt;em&gt; juga meningkatkan aksesibilitas, karena pembaca layar dapat memberikan penekanan pada teks tersebut.', '2025-07-12 16:01:54'),
(13, 37, 148, 'Tag &lt;ol&gt; digunakan untuk membuat daftar terurut, di mana setiap item dalam daftar akan diberi nomor secara otomatis. Ini berbeda dengan tag &lt;ul&gt;, yang digunakan untuk membuat daftar tidak terurut dengan bullet point. Dengan menggunakan &lt;ol&gt;, Anda dapat membuat daftar yang jelas dan terstruktur berdasarkan urutan angka atau huruf.', '2025-07-12 16:01:56'),
(14, 38, 151, 'Tag &lt;ul&gt; digunakan untuk membuat daftar tidak terurut dalam HTML. Daftar ini biasanya ditandai dengan simbol atau titik di depan setiap item. Dengan menggunakan tag &lt;ul&gt;, Anda dapat menyusun informasi dalam format yang lebih terstruktur dan mudah dibaca.', '2025-07-12 16:01:57'),
(15, 39, 153, 'Setiap item dalam daftar HTML ditulis menggunakan tag &lt;li&gt;. Tag &lt;li&gt; berfungsi untuk mendefinisikan elemen daftar, baik dalam daftar terurut (&lt;ol&gt;) maupun tidak terurut (&lt;ul&gt;). Sementara itu, tag &lt;ul&gt; digunakan untuk menentukan bahwa daftar tersebut adalah daftar tidak terurut, tetapi tidak digunakan untuk item itu sendiri.', '2025-07-12 16:01:59'),
(16, 40, 158, 'Tag &lt;ol&gt; digunakan untuk membuat daftar yang terurut, di mana setiap item dalam daftar akan memiliki nomor secara otomatis. Dalam kode tersebut, terdapat dua item yang masing-masing didefinisikan dengan tag &lt;li&gt;, yaitu &quot;HTML&quot; dan &quot;CSS&quot;. Oleh karena itu, hasilnya adalah &quot;HTML&quot; dan &quot;CSS&quot; ditampilkan sebagai daftar bernomor.', '2025-07-12 16:02:01'),
(17, 41, 162, 'Tag &lt;blockquote&gt; digunakan dalam HTML untuk menampilkan kutipan panjang dari sumber lain. Tag ini biasanya digunakan untuk menandai teks yang diambil dari dokumen atau karya lain, dan sering kali ditampilkan dengan indentasi atau dengan gaya berbeda untuk membedakannya dari teks biasa. Dengan menggunakan tag &lt;blockquote&gt;, pembaca dapat dengan mudah mengenali bahwa teks tersebut merupakan kutipan.', '2025-07-12 16:02:03'),
(18, 42, 167, 'Tag &lt;blockquote&gt; digunakan untuk menandai kutipan panjang dari sumber lain. Teks di dalam tag ini biasanya ditampilkan dengan jarak masuk ke dalam (indent) untuk membedakannya dari teks biasa. Hal ini membantu pembaca mengenali bahwa teks tersebut adalah kutipan dan bukan bagian dari teks utama.', '2025-07-12 16:02:04'),
(19, 43, 170, 'Tag &lt;cite&gt; digunakan untuk menandai sumber rujukan, seperti judul buku, artikel, atau karya lainnya. Dengan menggunakan tag ini, kita memberikan penghargaan kepada penulis asli dan memudahkan pembaca untuk menemukan sumber informasi. Oleh karena itu, jawaban yang benar adalah &apos;Menandai kutipan langsung dari buku atau artikel&apos;.', '2025-07-12 16:02:08'),
(20, 44, 173, 'Jawaban yang benar adalah &apos;Benar, karena teks kutipan dibungkus dengan &lt;blockquote&gt;&apos; karena tag &lt;blockquote&gt; digunakan untuk menandai kutipan panjang dari sumber lain. Penggunaan tag &lt;p&gt; tidak wajib di dalam &lt;blockquote&gt;, meskipun dapat digunakan untuk memperjelas struktur. Dengan demikian, contoh yang diberikan sudah sesuai dengan penggunaan tag &lt;blockquote&gt; yang benar.', '2025-07-12 16:02:10'),
(41, 25, NULL, 'Tag &lt;h1&gt; digunakan untuk membuat judul terbesar dalam HTML. Tag ini memiliki tingkat kepentingan tertinggi dan biasanya digunakan untuk judul utama sebuah halaman atau artikel. Penggunaan &lt;h1&gt; membantu mesin pencari memahami struktur konten dan meningkatkan SEO.', '2025-07-12 16:02:25'),
(42, 26, NULL, 'HTML menyediakan enam tingkat heading yang berbeda, yaitu dari &lt;h1&gt; hingga &lt;h6&gt;. Tag &lt;h1&gt; biasanya digunakan untuk judul utama, sedangkan &lt;h6&gt; digunakan untuk subjudul yang lebih rendah. Setiap tingkat heading memiliki tingkat kepentingan yang berkurang, yang membantu dalam struktur dan hierarki konten pada halaman web.', '2025-07-12 16:02:27'),
(43, 27, NULL, 'Tag &lt;h6&gt; digunakan untuk menandai heading dengan ukuran paling kecil dalam HTML. Heading memiliki urutan dari &lt;h1&gt; yang terbesar hingga &lt;h6&gt; yang terkecil, sehingga &lt;h6&gt; menunjukkan hierarki teks yang lebih rendah. Dengan menggunakan &lt;h6&gt;, Anda dapat memberikan struktur yang jelas pada konten Anda.', '2025-07-12 16:02:28'),
(44, 28, NULL, 'Sebaiknya hanya ada satu tag &lt;h1&gt; dalam satu halaman HTML karena tag ini berfungsi sebagai judul utama yang menggambarkan isi halaman. Memiliki lebih dari satu tag &lt;h1&gt; dapat membingungkan mesin pencari dalam memahami hierarki konten, yang dapat berdampak negatif pada optimasi SEO. Dengan menjaga struktur yang jelas, halaman menjadi lebih mudah diindeks dan dipahami oleh pengguna dan mesin pencari.', '2025-07-12 16:02:30'),
(45, 29, NULL, 'Tag &lt;p&gt; digunakan untuk membuat paragraf teks di HTML. Tag ini secara otomatis memberikan jarak antar paragraf dan membantu dalam pengaturan struktur konten. Dengan menggunakan &lt;p&gt;, teks akan diolah sebagai satu kesatuan yang terpisah dari elemen lain.', '2025-07-12 16:02:31'),
(46, 30, NULL, 'Tag &lt;br&gt; digunakan untuk membuat jeda baris baru dalam teks tanpa memulai paragraf baru. Ini berguna ketika Anda ingin memisahkan kalimat atau frasa dalam satu paragraf agar lebih mudah dibaca. Dengan menggunakan &lt;br&gt;, konten tetap dalam konteks yang sama tetapi ditampilkan di baris yang berbeda.', '2025-07-12 16:02:32'),
(47, 31, NULL, 'Tag &lt;p&gt; digunakan untuk menampilkan paragraf teks dalam dokumen HTML. Tag ini membantu mengatur teks agar lebih terstruktur dan mudah dibaca. Dengan menggunakan tag &lt;p&gt;, browser akan memberikan jarak antar paragraf secara otomatis, membuat tampilan halaman web menjadi lebih rapi.', '2025-07-12 16:02:34'),
(48, 32, NULL, 'Tag &lt;br&gt; digunakan untuk menyisipkan garis baru dalam teks HTML. Dalam contoh &lt;p&gt;Halo&lt;br&gt;Selamat datang&lt;/p&gt;, tag &lt;br&gt; memisahkan &quot;Halo&quot; dan &quot;Selamat datang&quot; sehingga &quot;Selamat datang&quot; muncul di baris baru. Dengan demikian, hasil yang ditampilkan adalah &quot;Halo&quot; di baris pertama dan &quot;Selamat datang&quot; di baris kedua.', '2025-07-12 16:02:36'),
(49, 33, NULL, 'Tag &lt;b&gt; digunakan untuk memberikan penekanan visual pada teks dengan menjadikannya tebal. Ini sering digunakan untuk menyoroti informasi penting dalam sebuah halaman web. Meskipun tag ini hanya mengubah tampilan, tidak memberikan makna semantik, tag &lt;strong&gt; lebih disarankan untuk menandai pentingnya teks dari segi makna.', '2025-07-12 16:02:37'),
(50, 34, NULL, 'Tag &lt;i&gt; digunakan untuk membuat teks miring dalam HTML. Teks yang dibungkus dengan tag ini biasanya menunjukkan penekanan atau istilah asing. Selain itu, penggunaan &lt;i&gt; juga membantu dalam meningkatkan keterbacaan dan menyampaikan makna khusus dalam konteks tertentu.', '2025-07-12 16:02:38'),
(51, 35, NULL, 'Tag &lt;b&gt; digunakan untuk membuat teks tebal secara visual tanpa memberikan arti tambahan pada konten tersebut. Sementara itu, tag &lt;strong&gt; tidak hanya membuat teks tebal, tetapi juga menunjukkan bahwa teks tersebut memiliki pentingnya konteks, yang dapat memengaruhi cara pembaca atau mesin pencari memahami informasi tersebut. Dengan begitu, penggunaan &lt;strong&gt; lebih relevan dalam konteks aksesibilitas dan SEO.', '2025-07-12 16:02:41'),
(52, 36, NULL, 'Tag &lt;em&gt; digunakan untuk menandai teks yang perlu diberi penekanan secara semantik, yang biasanya ditampilkan dalam format miring. Ini membantu pembaca dan mesin pencari memahami bahwa teks tersebut memiliki makna atau pentingnya lebih dibandingkan dengan teks lainnya. Selain itu, penggunaan tag &lt;em&gt; juga mendukung aksesibilitas bagi pengguna pembaca layar.', '2025-07-12 16:02:42'),
(53, 37, NULL, 'Tag &lt;ol&gt; digunakan untuk membuat daftar terurut, di mana item-item dalam daftar tersebut akan ditampilkan dengan urutan angka atau huruf. Tag ini cocok untuk situasi di mana penting untuk menunjukkan urutan atau ranking dari item yang disajikan. Setiap item dalam daftar terurut tersebut harus dibungkus dengan tag &lt;li&gt;.', '2025-07-12 16:02:44'),
(54, 38, NULL, 'Tag &lt;ul&gt; digunakan untuk membuat daftar tidak terurut, yang ditampilkan dengan simbol atau titik di depan setiap item. Ini berguna untuk menyusun informasi secara terstruktur tanpa urutan tertentu. Dengan menggunakan tag &lt;ul&gt;, pengguna dapat dengan mudah memahami item-item yang ada dalam daftar tersebut.', '2025-07-12 16:02:46'),
(55, 39, NULL, 'Setiap item dalam daftar HTML ditulis menggunakan tag &lt;li&gt; karena tag ini berfungsi untuk menandai item dalam daftar yang terurut (&lt;ol&gt;) atau tidak terurut (&lt;ul&gt;). Dengan menggunakan tag &lt;li&gt;, browser dapat mengenali dan menampilkan item-item tersebut dengan benar. Oleh karena itu, tag &lt;li&gt; adalah elemen penting dalam struktur daftar di HTML.', '2025-07-12 16:02:47'),
(56, 40, NULL, 'Kode yang diberikan menggunakan tag &lt;ol&gt; yang berarti &quot;ordered list&quot; atau daftar bernomor. Di dalamnya terdapat dua item daftar yang ditandai dengan tag &lt;li&gt;, yaitu &quot;HTML&quot; dan &quot;CSS&quot;. Oleh karena itu, hasilnya adalah &quot;HTML&quot; dan &quot;CSS&quot; ditampilkan sebagai daftar bernomor.', '2025-07-12 16:02:48'),
(57, 41, NULL, 'Tag &lt;blockquote&gt; digunakan dalam HTML untuk menampilkan kutipan panjang yang diambil dari sumber lain. Tag ini biasanya akan memberikan indentasi secara otomatis untuk membedakan teks kutipan dari teks biasa. Penggunaan &lt;blockquote&gt; juga membantu dalam memberikan konteks dan pengakuan atas sumber kutipan tersebut.', '2025-07-12 16:02:49'),
(58, 42, NULL, 'Tag &lt;blockquote&gt; digunakan untuk menampilkan kutipan dari sumber lain. Teks yang ada di dalam tag ini biasanya akan diberi jarak masuk ke dalam (indent) untuk membedakannya dari teks biasa. Hal ini membantu pembaca mengenali bahwa teks tersebut adalah kutipan yang diambil dari sumber lain.', '2025-07-12 16:02:51'),
(59, 43, NULL, 'Tag &lt;cite&gt; digunakan untuk menandai sumber atau referensi dari kutipan yang diambil, seperti buku, artikel, atau karya lain. Penggunaan tag ini memberikan konteks dan menghargai karya orang lain yang dijadikan rujukan. Dengan menggunakan tag &lt;cite&gt;, pembaca dapat mengetahui sumber informasi yang lebih jelas dan kredibel.', '2025-07-12 16:02:52'),
(60, 44, NULL, 'Jawaban tersebut benar karena tag &lt;blockquote&gt; digunakan untuk menandai kutipan panjang dari sumber lain. Dengan membungkus teks &quot;Belajar HTML itu menyenangkan!&quot; dalam tag &lt;blockquote&gt;, kita memberi tahu bahwa teks tersebut merupakan kutipan yang diambil dari konteks lain. Penggunaan tag ini juga biasanya disertai dengan format yang berbeda untuk membedakan kutipan dari teks biasa.', '2025-07-12 16:02:54'),
(61, 25, NULL, 'Tag &lt;h1&gt; digunakan untuk membuat judul terbesar dalam HTML. Tag ini menandakan tingkat pentingnya konten dan biasanya digunakan untuk judul utama dari sebuah halaman. Penggunaan &lt;h1&gt; membantu mesin pencari memahami struktur dan hierarki konten di dalam halaman web.', '2025-07-12 16:03:25'),
(62, 26, NULL, 'Dalam HTML, terdapat enam tingkat heading yang tersedia, yaitu &lt;h1&gt;, &lt;h2&gt;, &lt;h3&gt;, &lt;h4&gt;, &lt;h5&gt;, dan &lt;h6&gt;. Masing-masing tag heading ini memiliki tingkat kepentingan yang berbeda, di mana &lt;h1&gt; adalah yang paling penting dan biasanya digunakan untuk judul utama. Penggunaan heading yang tepat membantu dalam strukturisasi konten dan optimasi SEO.', '2025-07-12 16:03:27'),
(63, 27, NULL, 'Tag &lt;h6&gt; digunakan untuk mendefinisikan heading dengan ukuran paling kecil dalam HTML. Tag heading ini memiliki tingkat penting yang lebih rendah dibandingkan dengan &lt;h1&gt; hingga &lt;h5&gt;. Dengan menggunakan &lt;h6&gt;, Anda dapat menandai subjudul atau informasi yang kurang penting di dalam konten.', '2025-07-12 16:03:28'),
(64, 28, NULL, 'Hanya satu tag &lt;h1&gt; dalam satu halaman HTML sebaiknya digunakan untuk menandakan judul utama atau tema halaman tersebut. Ini membantu mesin pencari memahami fokus konten dan meningkatkan optimasi SEO. Selain itu, struktur yang jelas memudahkan pengguna dalam menavigasi konten halaman.', '2025-07-12 16:03:29'),
(65, 29, NULL, 'Tag &lt;p&gt; digunakan untuk mendefinisikan paragraf dalam HTML. Dengan menggunakan tag ini, teks akan dikelompokkan menjadi satu blok paragraf yang terpisah dari elemen lainnya. Ini membantu dalam pengaturan tata letak dan pembacaan konten di halaman web.', '2025-07-12 16:03:30'),
(66, 30, NULL, 'Tag &lt;br&gt; digunakan untuk membuat jeda baris dalam teks tanpa memulai paragraf baru. Ini berguna ketika Anda ingin memisahkan baris dalam satu blok teks, tetapi tidak ingin membuat jarak yang lebih besar seperti yang dilakukan oleh tag &lt;p&gt;. Dengan menggunakan &lt;br&gt;, teks akan tetap berada dalam konteks yang sama, tetapi tampil di baris yang berbeda.', '2025-07-12 16:03:43'),
(67, 31, NULL, 'Tag &lt;p&gt; digunakan untuk menampilkan paragraf teks dalam dokumen HTML. Dengan menggunakan tag ini, konten dapat diorganisir menjadi bagian-bagian yang terpisah dan mudah dibaca. Setiap paragraf yang didefinisikan dengan tag &lt;p&gt; akan memiliki jarak atau spasi yang sesuai di antara paragraf-paragraf lainnya.', '2025-07-12 16:03:44'),
(68, 32, NULL, 'Tag &lt;br&gt; digunakan untuk membuat jeda baris dalam HTML. Ketika Anda menulis &lt;p&gt;Halo&lt;br&gt;Selamat datang&lt;/p&gt;, teks &quot;Halo&quot; akan ditampilkan, diikuti oleh &lt;br&gt; yang memindahkan &quot;Selamat datang&quot; ke baris baru. Oleh karena itu, &quot;Selamat datang&quot; muncul di baris baru setelah &quot;Halo&quot;.', '2025-07-12 16:03:46'),
(69, 33, NULL, 'Tag &lt;b&gt; digunakan untuk membuat teks tebal dalam HTML. Ketika teks dibungkus dengan tag ini, browser akan menampilkan teks tersebut dalam format tebal, tanpa menambahkan makna semantik tambahan. Selain itu, tag ini sering digunakan untuk menekankan pentingnya bagian tertentu dari teks.', '2025-07-12 16:03:47'),
(70, 34, NULL, 'Tag &lt;i&gt; digunakan untuk membuat teks miring dalam HTML. Penggunaan tag ini biasanya menunjukkan penekanan atau menandakan istilah asing. Teks yang diberi tag &lt;i&gt; akan ditampilkan dengan gaya miring oleh browser.', '2025-07-12 16:03:48'),
(71, 35, NULL, 'Tag &lt;b&gt; digunakan untuk membuat teks tebal hanya dengan tujuan tampilan visual tanpa memberikan makna semantik. Sementara itu, tag &lt;strong&gt; tidak hanya membuat teks tebal, tetapi juga menunjukkan bahwa teks tersebut memiliki arti penting, sehingga lebih berarti dalam konteks aksesibilitas dan SEO. Oleh karena itu, penggunaan tag &lt;strong&gt; lebih dianjurkan ketika ingin menekankan pentingnya suatu informasi.', '2025-07-12 16:03:50'),
(72, 36, NULL, 'Tag &lt;em&gt; digunakan untuk menandai teks yang penting secara semantik, yang biasanya ditampilkan dalam format miring. Penggunaan tag ini membantu mesin pencari dan pembaca layar memahami konteks penting dari teks tersebut. Dengan demikian, tag &lt;em&gt; tidak hanya berfungsi untuk penampilan, tetapi juga untuk meningkatkan aksesibilitas dan pemahaman konten.', '2025-07-12 16:03:51'),
(73, 37, NULL, 'Tag &lt;ol&gt; digunakan untuk membuat daftar terurut, yang berarti item-item dalam daftar tersebut akan muncul dengan urutan angka atau huruf. Setiap item dalam daftar terurut diapit oleh tag &lt;li&gt; untuk menunjukkan setiap entri. Dengan menggunakan &lt;ol&gt;, kita dapat menciptakan struktur yang jelas dan terorganisir untuk informasi yang disajikan.', '2025-07-12 16:03:53'),
(74, 38, NULL, 'Tag &lt;ul&gt; digunakan dalam HTML untuk membuat daftar yang tidak terurut, yang biasanya ditandai dengan simbol atau titik di depan setiap item. Dengan menggunakan tag &lt;ul&gt;, kita dapat menyusun item-item dalam format yang terorganisir dan mudah dibaca. Setiap item dalam daftar tersebut ditulis menggunakan tag &lt;li&gt; yang menunjukkan elemen daftar.', '2025-07-12 16:03:54'),
(75, 39, NULL, 'Setiap item dalam daftar HTML ditulis menggunakan tag &lt;li&gt; karena tag ini khusus dirancang untuk mendefinisikan elemen dalam daftar. Tag &lt;li&gt; dapat digunakan dalam daftar yang tidak terurut (&lt;ul&gt;) atau daftar yang terurut (&lt;ol&gt;). Dengan menggunakan tag &lt;li&gt;, setiap item akan diatur secara terstruktur dalam tampilan daftar.', '2025-07-12 16:03:55'),
(76, 40, NULL, 'Kode &lt;ol&gt; digunakan untuk membuat daftar terurut atau daftar bernomor. Di dalamnya terdapat dua item &lt;li&gt;, yaitu &quot;HTML&quot; dan &quot;CSS&quot;. Dengan demikian, hasilnya adalah &quot;HTML&quot; dan &quot;CSS&quot; yang ditampilkan sebagai daftar bernomor.', '2025-07-12 16:03:56'),
(77, 41, NULL, 'Tag &lt;blockquote&gt; digunakan dalam HTML untuk menampilkan kutipan panjang dari sumber lain. Tag ini biasanya memberikan indentasi atau pemisahan visual dari teks lainnya, sehingga pembaca dapat dengan mudah mengenali bahwa itu adalah kutipan. Selain itu, penggunaan tag &lt;blockquote&gt; juga membantu dalam memberikan atribusi yang jelas kepada sumber kutipan tersebut.', '2025-07-12 16:03:58'),
(78, 42, NULL, 'Tag &lt;blockquote&gt; digunakan untuk menampilkan kutipan panjang dari sumber lain. Secara default, teks dalam tag ini akan diberi jarak masuk ke dalam (indent) untuk membedakannya dari teks lainnya. Hal ini membantu pembaca untuk mengenali bahwa teks tersebut adalah kutipan yang diambil dari sumber berbeda.', '2025-07-12 16:03:59'),
(79, 43, NULL, 'Tag &lt;cite&gt; digunakan untuk menandai sumber atau referensi dari sebuah kutipan, judul buku, artikel, atau karya lainnya. Dengan menggunakan tag ini, kita memberikan kredit kepada penulis asli dan membantu pembaca menemukan sumber informasi yang lebih lanjut. Selain itu, penggunaan tag &lt;cite&gt; juga berkontribusi pada struktur semantik yang lebih baik dalam dokumen HTML.', '2025-07-12 16:04:00'),
(80, 44, NULL, 'Jawaban tersebut benar karena tag &lt;blockquote&gt; digunakan untuk menandai kutipan panjang dari sumber lain. Dalam contoh tersebut, teks &quot;Belajar HTML itu menyenangkan!&quot; dibungkus dengan &lt;blockquote&gt;, yang sesuai dengan fungsi tag ini. Dengan demikian, penggunaan tag &lt;blockquote&gt; sudah tepat untuk menampilkan kutipan.', '2025-07-12 16:04:02'),
(81, 46, NULL, 'Di PHP, komentar satu baris ditandai dengan simbol // di awal baris. Segala teks yang ditulis setelah simbol tersebut akan diabaikan oleh interpreter PHP. Oleh karena itu, \'// Ini komentar\' adalah contoh yang tepat untuk menuliskan komentar satu baris.', '2025-07-12 19:19:04'),
(82, 45, NULL, 'Tag pembuka standar dalam PHP adalah <?php dan tag penutupnya adalah ?>. Tag ini digunakan untuk menandai awal dan akhir blok kode PHP dalam sebuah file. Semua kode PHP ditulis di antara kedua tag tersebut agar dapat dieksekusi oleh server.', '2025-07-12 19:19:07'),
(83, 47, NULL, 'Nama variabel yang valid di PHP harus dimulai dengan tanda dolar ($) diikuti oleh huruf atau garis bawah (_), dan dapat diikuti oleh huruf, angka, atau garis bawah. Variabel $jumlah memenuhi kriteria ini karena diawali dengan $ dan diikuti oleh huruf. Oleh karena itu, $jumlah adalah nama variabel yang valid di PHP.', '2025-07-12 19:19:11'),
(84, 48, NULL, 'Kode PHP tersebut mendeklarasikan variabel $nama dengan nilai \"Ali\". Kemudian, perintah echo digunakan untuk menampilkan nilai dari variabel tersebut. Oleh karena itu, output yang dihasilkan adalah \"Ali\".', '2025-07-12 19:19:12'),
(85, 49, NULL, 'Tipe data string di PHP ditandai dengan penggunaan tanda kutip, baik tanda kutip ganda <code>\"</code> maupun tanda kutip tunggal <code>\'</code>. Penggunaan tanda kutip ini diperlukan untuk membedakan string dari tipe data lainnya. Dengan demikian, karakter di dalam tanda kutip akan dianggap sebagai nilai string dalam kode PHP.', '2025-07-12 19:19:14'),
(86, 50, NULL, 'Jawaban \'define(\"PI\", 3.14);\' adalah benar karena fungsi <code>define</code> digunakan untuk mendeklarasikan konstanta di PHP. Konstanta adalah nilai yang tidak dapat diubah setelah dideklarasikan, dan dalam contoh ini, \"PI\" adalah nama konstanta dengan nilai 3.14. Penggunaan tanda kutip ganda pada \"PI\" penting untuk menunjukkan bahwa itu adalah sebuah string.', '2025-07-12 19:19:16'),
(87, 51, NULL, 'Komentar dalam program PHP, yang ditandai dengan tag <\\-- --> untuk komentar multi-baris atau // untuk komentar satu baris, berfungsi untuk memberi catatan pada kode. Ini membantu programmer dan orang lain yang membaca kode tersebut untuk memahami tujuan dan logika di balik bagian tertentu dari kode. Dengan adanya komentar, kode menjadi lebih mudah dibaca dan dipelajari, sehingga memudahkan pemeliharaan di masa depan.', '2025-07-12 19:19:18'),
(88, 52, NULL, 'Dalam PHP, tipe data dasar yang umum digunakan adalah integer, float, string, dan boolean. Namun, \'Character\' bukanlah tipe data dasar yang diakui secara resmi di PHP, karena karakter biasanya dianggap sebagai bagian dari tipe data string. Jadi, jawaban yang benar adalah \'Character\' karena tidak termasuk dalam kategori tipe data dasar di PHP.', '2025-07-12 19:19:20'),
(89, 53, NULL, 'PHP dapat disisipkan ke dalam HTML dengan menggunakan tag pembuka dan penutup PHP, yaitu <?php dan ?>. Ketika server web memproses file dengan ekstensi .php, ia akan mengeksekusi kode PHP di dalam tag tersebut dan menghasilkan output yang dapat digabungkan dengan HTML. Ini memungkinkan pengembang untuk menciptakan halaman web dinamis yang berinteraksi dengan basis data dan menghasilkan konten yang berbeda sesuai permintaan pengguna.', '2025-07-12 19:19:22'),
(90, 54, NULL, 'Dalam kode tersebut, variabel $x adalah angka 5 dan variabel $y adalah string \"5\". Operator perbandingan == melakukan perbandingan nilai tanpa memperhatikan tipe data, sehingga kedua nilai tersebut dianggap sama. Oleh karena itu, output dari var_dump adalah bool(true), yang menunjukkan bahwa perbandingan tersebut menghasilkan nilai benar.', '2025-07-12 19:19:23'),
(91, 55, NULL, 'Jawaban yang benar adalah \'/* komentar */\' karena sintaks ini digunakan untuk membuat komentar multibaris dalam PHP. Komentar ini akan diabaikan oleh interpreter PHP dan dapat digunakan untuk menjelaskan kode atau menonaktifkan bagian kode tanpa menghapusnya. Dengan menggunakan tanda \'/*\' untuk memulai dan \'*/\' untuk mengakhiri, kita dapat menulis komentar yang lebih panjang dalam satu blok.', '2025-07-12 19:19:25'),
(92, 56, NULL, 'Pernyataan \"Harus dideklarasikan tipe datanya\" adalah salah karena PHP adalah bahasa pemrograman yang bersifat dinamis. Dalam PHP, variabel tidak perlu dideklarasikan dengan tipe data tertentu, karena tipe data ditentukan secara otomatis saat nilai diberikan. Oleh karena itu, variabel dapat menyimpan nilai dari berbagai tipe data tanpa perlunya deklarasi eksplisit.', '2025-07-12 19:19:27'),
(93, 57, NULL, 'Jawaban yang benar adalah \'echo \"Hello World\";\' karena perintah echo dalam PHP digunakan untuk mencetak teks ke layar. Dengan menggunakan tanda kutip ganda, teks \"Hello World\" akan ditampilkan sebagai output. Ini adalah cara yang paling sederhana dan umum untuk menampilkan informasi kepada pengguna dalam PHP.', '2025-07-12 19:19:28'),
(94, 58, NULL, 'Dalam kode PHP tersebut, konstanta \"NAMA\" didefinisikan dengan nilai \"Budi\" menggunakan fungsi define. Ketika perintah echo NAMA dijalankan, ia akan menampilkan nilai dari konstanta tersebut. Oleh karena itu, output dari kode tersebut adalah \'Budi\'.', '2025-07-12 19:19:30'),
(95, 59, NULL, 'PHP mengenali file yang berisi skrip PHP melalui ekstensi file. File dengan ekstensi <code>.php</code> akan diproses oleh server sebagai skrip PHP. Jika file memiliki ekstensi lain, seperti <code>.html</code> atau <code>.txt</code>, maka server tidak akan menginterpretasikan kode PHP di dalamnya.', '2025-07-12 19:19:31'),
(96, 60, NULL, 'Tipe data boolean di PHP hanya memiliki dua nilai, yaitu <code>true</code> dan <code>false</code>, yang digunakan untuk merepresentasikan kondisi benar atau salah. Nilai <code>true</code> biasanya menunjukkan bahwa suatu pernyataan atau kondisi adalah benar, sedangkan <code>false</code> menunjukkan bahwa pernyataan tersebut salah. Dengan demikian, tipe data boolean sangat penting dalam pengendalian alur program, seperti dalam pernyataan kondisi dan perulangan.', '2025-07-12 19:19:34'),
(97, 61, NULL, 'Kode tersebut menggunakan fungsi gettype() untuk menentukan tipe data dari nilai yang diberikan, yaitu 3.14. Dalam PHP, angka desimal seperti 3.14 dikategorikan sebagai tipe data <b>double</b>. Oleh karena itu, output dari kode tersebut adalah \'double\'.', '2025-07-12 19:19:35'),
(98, 62, NULL, 'Tipe data <array> dalam PHP digunakan untuk menyimpan beberapa nilai dalam satu variabel. Dengan <array>, Anda dapat menyimpan data dengan tipe yang berbeda, baik itu angka, string, atau bahkan <array> lainnya. Ini membuat <array> sangat fleksibel dan berguna untuk mengelola kumpulan data.', '2025-07-12 19:19:37'),
(99, 63, NULL, 'PHP adalah bahasa pemrograman yang dieksekusi di server. Ketika file disimpan dengan ekstensi .php, server web akan mengenali dan memproses kode PHP yang ada di dalamnya sebelum mengirimkan hasilnya sebagai HTML ke browser. Oleh karena itu, untuk menjalankan skrip PHP, file harus diakses melalui server yang mendukung PHP.', '2025-07-12 19:19:39'),
(100, 64, NULL, 'Fungsi <code>var_dump()</code> dalam PHP digunakan untuk menampilkan informasi tentang variabel, termasuk tipe datanya dan nilai yang terkandung di dalamnya. Fungsi ini sangat berguna untuk debugging karena memberikan detail yang mendalam tentang struktur dan isi variabel. Dengan menggunakan <code>var_dump()</code>, pengembang dapat dengan mudah melihat bagaimana data disimpan dan digunakan dalam aplikasi.', '2025-07-12 19:19:41'),
(101, 66, NULL, 'Tanda kurung kurawal {} dalam CSS digunakan untuk mengelompokkan aturan yang diterapkan pada elemen tertentu. Setiap aturan yang ditulis di dalam kurung kurawal akan berfungsi untuk mengatur berbagai properti dari elemen tersebut. Dengan demikian, tanda kurung kurawal membantu dalam mengorganisasi dan memisahkan gaya untuk elemen yang berbeda dalam dokumen HTML.', '2025-07-12 19:20:56'),
(102, 65, NULL, 'Jawaban yang benar adalah \'properti: nilai;\' karena ini adalah format dasar untuk mendefinisikan aturan CSS. Dalam sintaks ini, \'properti\' menunjukkan atribut yang ingin diubah, sedangkan \'nilai\' adalah pengaturan yang ingin diterapkan pada atribut tersebut. Contohnya, dalam aturan CSS seperti \'color: red;\', \'color\' adalah properti dan \'red\' adalah nilai yang diberikan.', '2025-07-12 19:20:58'),
(103, 67, NULL, 'Dalam aturan CSS, setiap deklarasi terdiri dari properti dan nilai yang dipisahkan oleh tanda titik dua (:). Setelah menuliskan nilai, tanda titik koma (;) digunakan untuk mengakhiri deklarasi tersebut. Hal ini penting untuk memisahkan satu deklarasi dari deklarasi lainnya dalam satu blok aturan CSS.', '2025-07-12 19:20:59'),
(104, 68, NULL, 'Jawaban tersebut benar karena selector CSS berfungsi untuk menentukan elemen-elemen HTML mana yang akan dikenakan aturan gaya tertentu. Dengan menggunakan selector, kita dapat menargetkan elemen berdasarkan jenis tag, kelas, atau ID, sehingga gaya dapat diterapkan secara spesifik. Hal ini memungkinkan pengembang web untuk mengubah tampilan halaman secara efisien dan terorganisir.', '2025-07-12 19:21:01'),
(105, 69, NULL, 'Jawaban \'p { }\' adalah cara yang tepat untuk menyeleksi semua elemen <p> dalam dokumen HTML menggunakan CSS. Dengan menulis \'p\', kita memberi tahu CSS untuk menerapkan aturan gaya pada semua elemen <p> yang ada. Kurung kurawal \'{}\' digunakan untuk mendefinisikan aturan gaya yang ingin diterapkan pada elemen tersebut.', '2025-07-12 19:21:02'),
(106, 70, NULL, 'Selector #header dalam CSS digunakan untuk memilih elemen HTML yang memiliki atribut id dengan nilai \"header\". Tanda pagar (#) menunjukkan bahwa yang dipilih adalah id, bukan class atau elemen lainnya. Dengan demikian, hanya satu elemen yang dapat dipilih karena id harus unik dalam sebuah halaman HTML.', '2025-07-12 19:21:03'),
(107, 71, NULL, 'Jawaban yang benar adalah \'Memilih elemen dengan class “menu”\' karena selector dengan tanda titik (.) di depan menunjukkan bahwa kita merujuk pada class dalam CSS. Selector .menu akan menargetkan semua elemen HTML yang memiliki class \"menu\". Dengan demikian, gaya yang diterapkan akan berlaku hanya untuk elemen-elemen tersebut.', '2025-07-12 19:21:05'),
(108, 72, NULL, 'Selector \'*\' dalam CSS digunakan untuk memilih semua elemen dalam halaman. Dengan menggunakan selector ini, Anda dapat menerapkan gaya atau aturan pada setiap elemen tanpa terkecuali. Ini berguna untuk menetapkan gaya dasar yang konsisten di seluruh dokumen HTML.', '2025-07-12 19:21:07'),
(109, 73, NULL, 'Properti color di CSS digunakan untuk menentukan warna teks yang ditampilkan dalam elemen HTML. Dengan mengubah nilai properti ini, Anda dapat menyesuaikan tampilan teks agar sesuai dengan desain yang diinginkan. Misalnya, Anda bisa menggunakan color: red; untuk membuat teks berwarna merah.', '2025-07-12 19:21:08'),
(110, 74, NULL, 'Properti background-color digunakan dalam CSS untuk menentukan warna latar belakang dari suatu elemen HTML. Dengan menggunakan properti ini, pengguna dapat memberikan warna yang berbeda pada elemen, seperti <div>, <p>, atau <h1>. Hal ini berguna untuk meningkatkan estetika dan keterbacaan halaman web.', '2025-07-12 19:21:10'),
(111, 75, NULL, 'Untuk membuat teks menjadi rata tengah, Anda dapat menggunakan properti CSS <code>text-align</code> dengan nilai <code>center</code>. Ini akan mengatur posisi horizontal teks dalam elemen induknya agar berada di tengah. Misalnya, Anda bisa menambahkan <code>style=\"text-align: center;\"</code> pada tag <p> untuk meratakan teks di dalamnya.', '2025-07-12 19:21:12'),
(112, 76, NULL, 'Properti font-size digunakan dalam CSS untuk menentukan ukuran huruf pada elemen teks di halaman web. Dengan mengubah nilai font-size, kita dapat membuat teks lebih besar atau lebih kecil sesuai kebutuhan desain. Hal ini penting untuk meningkatkan keterbacaan dan estetika tampilan situs web.', '2025-07-12 19:21:13'),
(113, 77, NULL, 'Jawaban \'margin: 10px;\' adalah benar karena itu merupakan penulisan yang tepat untuk mengatur jarak luar suatu elemen dalam CSS. Properti margin mempengaruhi ruang di sekitar elemen, dan nilai \'10px\' menunjukkan ukuran margin dalam piksel. Penulisan ini mengikuti sintaks yang benar, yaitu menuliskan nama properti diikuti dengan nilai dan satuan.', '2025-07-12 19:21:15'),
(114, 78, NULL, 'Dalam CSS, komentar ditulis dengan menggunakan tanda /* untuk memulai dan */ untuk mengakhiri. Komentar ini tidak akan ditampilkan di halaman web dan berguna untuk memberikan penjelasan atau catatan dalam kode. Dengan cara ini, pengembang dapat menjelaskan bagian tertentu dari kode CSS tanpa mempengaruhi tampilan situs.', '2025-07-12 19:21:16'),
(115, 79, NULL, 'Komentar dalam file CSS digunakan untuk memberikan penjelasan atau catatan tentang bagian tertentu dari kode, sehingga memudahkan pengembang lain atau diri sendiri untuk memahami tujuan dan fungsi kode tersebut di masa mendatang. Komentar tidak akan memengaruhi tampilan atau perilaku halaman web karena tidak dieksekusi oleh browser. Dengan adanya komentar, pemeliharaan dan pengeditan kode menjadi lebih efisien.', '2025-07-12 19:21:18'),
(116, 80, NULL, 'Jawaban yang benar adalah <link rel=\"stylesheet\" href=\"style.css\"> karena tag <link> digunakan untuk menghubungkan file CSS eksternal ke dokumen HTML. Atribut rel dengan nilai \"stylesheet\" menunjukkan bahwa file yang dirujuk adalah lembar gaya, sementara atribut href menunjuk ke lokasi file CSS yang ingin dihubungkan. Dengan cara ini, gaya yang ditentukan dalam file CSS akan diterapkan pada elemen-elemen dalam dokumen HTML.', '2025-07-12 19:21:20'),
(117, 81, NULL, 'Tag <link> biasanya ditempatkan di dalam <head> karena fungsinya adalah untuk menghubungkan dokumen HTML dengan sumber daya eksternal seperti stylesheet. Dengan meletakkannya di dalam <head>, browser akan memuat stylesheet tersebut sebelum merender konten halaman, yang membantu dalam penampilan dan tata letak yang konsisten. Ini juga memastikan bahwa gaya halaman diterapkan dengan benar sebelum konten ditampilkan kepada pengguna.', '2025-07-12 19:21:22'),
(118, 82, NULL, 'Keuntungan menggunakan CSS eksternal adalah bahwa gaya dapat ditulis di satu file dan diterapkan ke banyak halaman web sekaligus. Hal ini membuat pemeliharaan lebih mudah, karena jika ada perubahan yang diperlukan, cukup mengedit satu file CSS. Selain itu, ini juga mengurangi ukuran file HTML, karena tidak perlu menulis gaya di setiap halaman secara langsung.', '2025-07-12 19:21:23'),
(119, 83, NULL, 'Inline CSS adalah cara untuk menerapkan gaya langsung pada elemen HTML dengan menggunakan atribut style di dalam tag HTML. Dengan menggunakan inline CSS, gaya diterapkan langsung pada elemen tertentu, sehingga mempengaruhi hanya elemen tersebut. Contoh penggunaan inline CSS adalah dengan menambahkan atribut style pada tag seperti <p style=\"color:red;\"> ini akan membuat teks menjadi merah.', '2025-07-12 19:21:24'),
(120, 84, NULL, 'Jawaban yang benar adalah <p style=\"color:red;\">Teks</p> karena ini adalah contoh penggunaan CSS secara langsung pada elemen HTML dengan atribut style. Dengan menggunakan atribut style, kita dapat mengatur tampilan elemen tersebut, dalam hal ini mengubah warna teks menjadi merah. Metode ini disebut inline CSS karena gaya diterapkan langsung pada elemen, bukan melalui file CSS terpisah atau tag <style>.', '2025-07-12 19:21:26'),
(121, 106, NULL, 'Properti font-family dalam CSS digunakan untuk menentukan jenis huruf yang akan diterapkan pada elemen teks di halaman web. Dengan menggunakan properti ini, Anda dapat memilih dari berbagai jenis huruf yang tersedia, baik yang telah terpasang di sistem pengguna maupun yang diimpor dari sumber lain. Ini membantu menciptakan tampilan yang konsisten dan menarik sesuai dengan desain yang diinginkan.', '2025-07-13 22:02:02'),
(122, 107, NULL, 'Jawaban yang benar adalah \'font-size\' karena properti ini digunakan dalam CSS untuk menentukan ukuran huruf dari teks. Dengan mengatur nilai \'font-size\', Anda dapat membuat teks lebih besar atau lebih kecil sesuai kebutuhan desain. Misalnya, Anda dapat menggunakan sintaks seperti \'font-size: 16px;\' untuk menetapkan ukuran huruf menjadi 16 piksel.', '2025-07-13 22:02:04'),
(123, 108, NULL, 'Nilai yang tepat untuk font-style agar teks menjadi miring adalah \'italic\' karena ini adalah nilai yang ditentukan dalam CSS untuk memberikan efek miring pada teks. Dengan menggunakan properti font-style dan menetapkan nilainya ke italic, teks akan ditampilkan dalam gaya miring. Contoh penggunaan dalam CSS adalah: font-style: italic;', '2025-07-13 22:02:06'),
(124, 109, NULL, 'Fungsi dari text-align dalam CSS adalah untuk mengontrol penyelarasan teks dalam elemen, baik itu kiri, kanan, tengah, atau justify. Dengan menggunakan properti ini, kita dapat menentukan bagaimana teks ditampilkan di dalam elemen, sehingga menciptakan tampilan yang lebih teratur dan estetis. Oleh karena itu, jawaban yang benar adalah \"Mengatur posisi teks secara horizontal\".', '2025-07-13 22:02:08'),
(125, 110, NULL, 'Jawaban yang benar adalah \'text-align: right;\' karena properti CSS ini digunakan untuk mengatur perataan teks dalam elemen. Ketika diterapkan, teks akan diratakan ke sisi kanan dari elemen kontainer. Anda dapat menggunakan kode CSS ini di dalam tag <style> atau langsung di dalam atribut style dari elemen HTML.', '2025-07-13 22:02:10'),
(126, 111, NULL, 'Properti CSS <line-height> digunakan untuk menentukan jarak vertikal antara garis teks dalam elemen. Dengan mengatur nilai <line-height>, kita dapat mengontrol tampilan teks agar lebih rapi dan mudah dibaca. Semakin tinggi nilai <line-height>, semakin besar jarak antar baris teks, yang dapat meningkatkan kenyamanan visual.', '2025-07-13 22:02:11'),
(127, 112, NULL, 'Jawaban yang benar adalah \'text-transform: uppercase;\' karena properti CSS ini digunakan untuk mengubah seluruh teks dalam elemen menjadi huruf besar. Dengan menambahkan aturan ini ke dalam CSS, semua huruf dalam elemen yang ditargetkan akan ditampilkan dalam format huruf besar tanpa mengubah konten asli. Ini memberikan kemudahan dalam penataan tampilan teks di halaman web.', '2025-07-13 22:02:13'),
(128, 113, NULL, 'Properti CSS <font-weight> digunakan untuk mengatur ketebalan huruf dalam teks. Nilai yang bisa diterapkan pada properti ini antara lain normal, bold, dan angka seperti 100 hingga 900. Dengan mengubah nilai <font-weight>, Anda dapat menciptakan variasi dalam penampilan teks sesuai kebutuhan desain.', '2025-07-13 22:02:15'),
(129, 114, NULL, 'Nilai font-weight yang menghasilkan huruf tebal adalah \'bold\'. Dalam CSS, nilai \'bold\' membuat teks lebih tebal dibandingkan dengan nilai normal. Anda dapat menggunakan <strong> atau <b> untuk menampilkan teks dengan penekanan tebal di HTML.', '2025-07-13 22:02:17'),
(130, 115, NULL, 'Jawaban \'Memberi garis bawah pada teks\' adalah benar karena properti CSS text-decoration dengan nilai underline secara spesifik dirancang untuk menambahkan garis bawah pada elemen teks. Ketika diterapkan, semua teks dalam elemen yang diberi properti ini akan terlihat dengan garis di bawahnya. Ini sering digunakan untuk menandai tautan atau menunjukkan penekanan pada bagian tertentu dari teks.', '2025-07-13 22:02:19'),
(131, 116, NULL, 'Jawaban yang benar adalah \'letter-spacing\' karena properti ini digunakan dalam CSS untuk mengatur jarak antara huruf dalam teks. Dengan mengubah nilai \'letter-spacing\', Anda dapat memperbesar atau memperkecil jarak antar karakter, sehingga memengaruhi tampilan keseluruhan teks. Properti ini sering digunakan untuk meningkatkan keterbacaan atau untuk efek estetika pada desain web.', '2025-07-13 22:02:21'),
(132, 117, NULL, 'Jawaban \'Mengatur paragraf pertama menjorok ke dalam\' adalah benar karena properti CSS text-indent digunakan untuk memberikan jarak indentasi pada paragraf pertama dalam sebuah elemen teks. Dengan menggunakan text-indent, Anda dapat menyesuaikan posisi awal teks untuk memberikan tampilan yang lebih rapi dan terstruktur. Ini sering digunakan dalam penulisan artikel atau dokumen untuk menandakan awal dari paragraf baru.', '2025-07-13 22:02:22'),
(133, 118, NULL, 'Nilai default dari properti CSS font-style adalah normal karena secara standar, teks akan ditampilkan dalam gaya biasa tanpa kemiringan. Ini berarti bahwa jika tidak ada pengaturan khusus yang diterapkan, teks akan muncul dalam bentuk standar. Dengan menggunakan nilai normal, kita memastikan bahwa teks tidak ditampilkan dalam gaya miring atau italic.', '2025-07-13 22:02:24'),
(134, 119, NULL, 'Jawaban \'font: italic 16px/1.5 \"Roboto\", sans-serif;\' adalah kombinasi shorthand CSS yang digunakan untuk mengatur berbagai properti font sekaligus. Dalam contoh ini, \'italic\' menunjukkan gaya font, \'16px\' adalah ukuran font, \'1.5\' adalah tinggi garis, dan \'\"Roboto\", sans-serif\' adalah jenis font yang digunakan. Dengan menggunakan shorthand ini, kita bisa mengatur semua properti tersebut dalam satu baris kode yang lebih ringkas.', '2025-07-13 22:02:26'),
(135, 120, NULL, 'Jawaban yang benar adalah \'text-align: justify\' karena nilai ini digunakan dalam CSS untuk meratakan teks sehingga terlihat rapi di kedua sisi, kiri dan kanan. Dengan menggunakan nilai ini, teks akan diatur sedemikian rupa sehingga jarak antar kata disesuaikan, menciptakan tampilan yang seimbang. Hal ini sering digunakan dalam tata letak dokumen dan artikel untuk meningkatkan keterbacaan.', '2025-07-13 22:02:28'),
(136, 121, NULL, 'Ketika properti CSS <letter-spacing> diatur dengan nilai yang besar, jarak antara huruf-huruf dalam teks akan bertambah. Hal ini dapat membuat teks terlihat lebih terpisah dan sulit dibaca jika jaraknya terlalu jauh. Oleh karena itu, penting untuk mengatur <letter-spacing> dengan proporsi yang sesuai agar teks tetap mudah dibaca.', '2025-07-13 22:02:29'),
(137, 122, NULL, 'Properti <word-spacing> digunakan dalam CSS untuk mengatur jarak antar kata dalam teks. Dengan mengubah nilai pada properti ini, Anda dapat menambah atau mengurangi spasi antara kata-kata, sehingga mempengaruhi tampilan dan keterbacaan teks. Hal ini berguna untuk meningkatkan estetika atau untuk memenuhi kebutuhan desain tertentu.', '2025-07-13 22:02:31'),
(138, 123, NULL, 'Jawaban \'text-shadow: 2px 2px #000;\' adalah benar karena properti CSS ini digunakan untuk menambahkan bayangan pada teks. Angka pertama dan kedua (2px 2px) menunjukkan posisi bayangan secara horizontal dan vertikal, sedangkan \'#000\' menentukan warna bayangan, dalam hal ini hitam. Dengan menggunakan properti ini, Anda dapat meningkatkan estetika teks di halaman web.', '2025-07-13 22:02:32'),
(139, 124, NULL, 'Properti white-space dalam CSS digunakan untuk mengontrol cara teks di dalam elemen HTML menangani spasi dan pemisahan baris. Dengan properti ini, pengguna dapat menentukan apakah spasi tambahan harus diabaikan, bagaimana baris baru harus ditangani, dan apakah teks harus membungkus atau tidak. Ini sangat berguna untuk mengatur tampilan teks agar sesuai dengan desain halaman web.', '2025-07-13 22:02:34'),
(140, 125, NULL, 'Jawaban yang benar adalah \'Salin CSS link dari Google Fonts ke <head>\' karena untuk menggunakan font dari Google Fonts, Anda perlu mengimpor stylesheet-nya ke dalam dokumen HTML. Dengan menambahkan link CSS tersebut di dalam tag <head>, browser dapat mengenali dan menerapkan font yang diinginkan pada elemen teks di halaman. Ini adalah langkah penting agar font khusus dapat ditampilkan dengan benar di situs web Anda.', '2025-07-13 22:02:36');
